import { getListings } from "./getListings/getListingFunc"

export default async (req, res) => {
    try{
        const resData = await getListings()
        if(!!resData){
            res.statusCode = 200;
            res.setHeader('Content-type', 'application/json');
            const result = {
                status: 200,
                data: resData
            }
            res.end(result)
        }
    }catch(err){
        res.statusCode = 400;
        res.setHeader('Content-type', 'application/json');
        const result = {
            status: 400,
            data: err
        }
        res.end(result)
    }
}
